import React, { Component } from 'react';
import "./../css/layout.css"
import "./../css/default.css"
import "./../css/fonts.css"
import "./../css/magnific-popup.css"
import "./../css/media-queries.css"
import linkedinlogo from './../assets/linkedin.png'
import maillogo from './../assets/mail.png'


class Social extends Component {
    render() {

        if (this.props.data.social !== undefined) {
            var socialList = this.props.data.social.map(function (social) {
                return <div key={social.name}>
                    <li>
                        <a href={social.url} class="link"><img className="linkedin-logo" src={social.imgname == "linkedinlogo" ? linkedinlogo : (social.imgname == "maillogo" ? maillogo : undefined)} alt={social.imgname + "Image"} /></a>
                    </li>
                </div>
            })
        }

        return (
            <section id="social">
                <ul id="socialList">
                    {socialList}
                </ul>
            </section>
        );
    }
}

export default Social;
